import './Styles/App.css';
import { Routes, Route, ProtectedRoute } from 'react-router-dom';
import Login from './Components/Login';
import Register from './Components/Register';
import Register2 from './Components/Register2';
import Home from './Components/Home';
import Dashboard from './Components/Dashboard';
import Appointments from './Components/Appointments';
import Settings from './Components/Settings';
import Topnav from './Components/Topnav';
import Navbar from './Components/Navbar';
import Clients from './Components/Clients';
import Technicians from './Components/Technicians';
import { useState, useEffect } from 'react';
import axios from './axios/axios';

const ADMIN_URL = '/auth/check-admin';

function App() {
  const name = 'Nikos';
  const surname = 'Korompos';
  const [isAdmin, setIsAdmin] = useState(false);

  useEffect(() => {
    const checkAdmin = async () => {
      try {
        const response = await axios.get(ADMIN_URL, {
          headers: { 'Content-Type': 'application/json' },
          withCredentials: true,
        });
        if (true) {
          console.log(response.data);
          setIsAdmin(true);
        }
      } catch (error) {
        console.log(error);
      }
    };
    checkAdmin();
  }, []);

  return (
    <div className='main'>
      <Topnav />
      <div className='main-wrapper'>
        <Navbar name={name} surname={surname} />
        <div className='components-wrapper'>
          <Routes>
            <Route path='/' element={<Home />} />
            <Route
              path='/login'
              element={<Login handleIsAdmin={handleIsAdmin} />}
            />
            <Route path='/register' element={<Register />} />
            <Route path='/register_2' element={<Register2 />} />
            <Route
              path='/dashboard'
              element={<Dashboard name={name} surname={surname} />}
            />
            <Route path='/appointments' element={<Appointments />} />
            <Route path='/technicians' element={<Technicians />} />
            <Route path='/clients' element={<Clients />} />
            <Route path='/settings' element={<Settings />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}

export default App;
